import React, { useState } from "react";
import { Calendar } from 'primereact/calendar';


const Agenda = () => {


    return(
        <>
        <Calendar selectionMode="multiple" value={dates} onChange={(e) => setDates(e.value)}></Calendar>
        </>
    )
}

export default Agenda;
